function sum(nums, target) {
  const arr = [];
  for(let i = 0; i < nums.length; i++) {
    const v = target - nums[i];
    const j = nums.indexOf(v);
    if(j !== -1) {
      arr.push(i, j);
      break;
    }
  }
  return arr;
}
